/*Table structure for table `user` */

DROP TABLE IF EXISTS `user`;

CREATE TABLE `user` (
  `id` int(8) NOT NULL AUTO_INCREMENT,
  `username` varchar(128) DEFAULT NULL COMMENT '用户名',
  `password` varchar(128) DEFAULT NULL COMMENT '密码',
  `mobile` varchar(16) DEFAULT NULL COMMENT '电话',
  `type` int(4) DEFAULT NULL COMMENT '用户类型（1-零售商，2-经销商，3-自营店卖家, 4-平台）',
  `parent_id` int(8) DEFAULT NULL COMMENT '父账号id(如果父账号id为1，则该账号为父账号，默认为1)',
  `email` varchar(255) DEFAULT NULL COMMENT '邮箱',
  `nickname` varchar(255) DEFAULT NULL COMMENT '昵称',
  `created_time` datetime DEFAULT NULL COMMENT '创建时间',
  `updated_time` datetime DEFAULT NULL COMMENT '更新时间',
  `deleted` int(4) DEFAULT NULL COMMENT '是否删除（1-删除，0-未删除，）',
  `status` int(4) DEFAULT NULL COMMENT '当前用户所处状态（1-普通用户待验证，2-普通用户验证通过，3-买家待审核，4-买家审核通过，5-卖家待审核，6-卖家审核通过）',
  `shop_id` bigint(20) DEFAULT NULL COMMENT '店铺ID',
  `paymentCode` varchar(128) DEFAULT NULL COMMENT '支付密码',
  `security_level` int(4) DEFAULT NULL COMMENT '安全等级',
  `oldPassword` varchar(128) DEFAULT NULL COMMENT '旧密码',
  `auditor` varchar(128) DEFAULT NULL COMMENT '审核人（用户username）',
  `audit_remark` varchar(255) DEFAULT NULL COMMENT '审核备注',
  `quick_type` int(4) DEFAULT NULL COMMENT '用户冻结状态；1未冻结  2 已冻结',
  `payment_status` int(2) DEFAULT NULL COMMENT '缴费状态1待确认，2已确认',
  `link_man` varchar(100) DEFAULT NULL COMMENT '联系人',
  `department` varchar(100) DEFAULT NULL COMMENT '部门',
  `link_phone_num` varchar(100) DEFAULT NULL COMMENT '联系人电话',
  `wxopenid` varchar(100) DEFAULT NULL COMMENT '微信绑定ID',
  `platform_id` bigint(20) DEFAULT NULL COMMENT '平台ID',
  `growth_value` decimal(20,2) DEFAULT NULL COMMENT '成长值',
  `zone_code` varchar(100) DEFAULT NULL COMMENT '所属区域代码',
  `zone_name` varchar(255) DEFAULT NULL COMMENT '所属区域名称',
  `icon_url` varchar(255) DEFAULT NULL COMMENT '用户头像url',
  `company_addr` varchar(255) CHARACTER SET utf32 DEFAULT NULL COMMENT '公司地址',
  `isFirstLogin` int(4) DEFAULT NULL COMMENT '判断是否第一次登陆；null第一次2第二次以上',
  `link_addr` varchar(255) DEFAULT NULL COMMENT '联系人地址新增字段',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1000002191 DEFAULT CHARSET=utf8;

