  `extend_id` bigint(20) NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) NOT NULL COMMENT '用户id',
  `company_name` varchar(512) DEFAULT NULL COMMENT '公司名称',
  `artificial_person_name` varchar(512) DEFAULT NULL COMMENT '法定代表人名称',
  `business_licence_id` varchar(512) DEFAULT NULL COMMENT '注册号（营业执照号）',
  `artificial_person_pic_src` varchar(512) DEFAULT NULL COMMENT '法人身份证电子版图片地址',
  `artificial_person_pic_back_src` varchar(1024) DEFAULT NULL COMMENT '法人身份证电子版图片地址(反面)',
  `registered_capital` varchar(512) DEFAULT NULL COMMENT '注册资金',
  `business_licence_pic_src` varchar(1024) DEFAULT NULL COMMENT '营业执照电子版图片地址',
  `business_scope` varchar(512) DEFAULT NULL COMMENT '经验范围',
  `business_licence_indate` datetime DEFAULT NULL COMMENT '营业执照有效期',
  `linkman` varchar(64) DEFAULT NULL COMMENT '联系人',
  `company_address` varchar(512) DEFAULT NULL COMMENT '公司地址',
  `company_phone` varchar(512) DEFAULT NULL COMMENT '公司电话',
  `business_status` int(2) DEFAULT NULL COMMENT '营业执照审核状态：0驳回/1待确认/2确认',
  `organization_id` varchar(512) DEFAULT NULL COMMENT '组织机构代码',
  `organization_pic_src` varchar(1024) DEFAULT NULL COMMENT '组织机构图片地址',
  `organization_status` int(2) DEFAULT NULL COMMENT '组织机构审核状态：0驳回/1待确认/2确认',
  `tax_man_id` varchar(512) DEFAULT NULL COMMENT '税务人识别号',
  `taxpayer_type` varchar(512) DEFAULT NULL COMMENT '纳税人类型',
  `taxpayer_code` varchar(512) DEFAULT NULL COMMENT '税务人类型税码',
  `tax_registration_certificate_pic_src` varchar(1024) DEFAULT NULL COMMENT '税务登记证电子版图片地址',
  `taxpayer_certificate_pic_src` varchar(1024) DEFAULT NULL COMMENT '纳税人资格证电子版图片地址',
  `tax_status` int(2) DEFAULT NULL COMMENT '税务审核状态：0驳回/1待确认/2确认',
  `bank_account_name` varchar(512) DEFAULT NULL COMMENT '银行开户名',
  `bank_account` varchar(512) DEFAULT NULL COMMENT '银行账号',
  `bank_name` varchar(512) DEFAULT NULL COMMENT '开户行支行名称',
  `bank_branch_joint_line` varchar(512) DEFAULT NULL COMMENT '开户行支行联行号',
  `bank_branch_is_located` varchar(512) DEFAULT NULL COMMENT '开户行支行所在地',
  `bank_account_permits_pic_src` varchar(1024) DEFAULT NULL COMMENT '银行开户许可证电子版图片地址',
  `bank_account_status` int(2) DEFAULT NULL COMMENT '银行账户状态：0驳回/1待确认/2确认',
  `is_citic_bank` int(2) DEFAULT '1' COMMENT '是否是中信本行 1是 0不是',
  `seller_frozen_account` varchar(512) DEFAULT NULL COMMENT '卖家冻结账户',
  `seller_withdraws_cash_account` varchar(512) DEFAULT NULL COMMENT '卖家收款账户',
  `buyer_pays_account` varchar(512) DEFAULT NULL COMMENT '买家支付账户',
  `buyer_financing_account` varchar(512) DEFAULT NULL COMMENT '买家融资账户',
  `account_state` int(2) DEFAULT '1' COMMENT '账号状态 0驳回/1待确认/2确认',
  `company_declined_address` varchar(200) DEFAULT NULL COMMENT '公司详细地址',
  `company_peo_num` varchar(200) DEFAULT NULL COMMENT '公司人数规模',
  `company_qualt` varchar(200) DEFAULT NULL COMMENT '公司性质',
  `business_scale` varchar(200) DEFAULT NULL COMMENT '经营规模',
  `is_financing` varchar(200) DEFAULT NULL COMMENT '是否融资',
  `financing_num` varchar(200) DEFAULT NULL COMMENT '融资金额',
  `id_card_type` varchar(200) DEFAULT NULL COMMENT '证件类型',
  `id_card_num` varchar(200) DEFAULT NULL COMMENT '证件号码',
  `business_licence_address` varchar(200) DEFAULT NULL COMMENT '营业执照所在地(省市县)',
  `business_licenc_address_detail` varchar(200) DEFAULT NULL COMMENT '详细地址',
  `business_licence_date` datetime DEFAULT NULL COMMENT '营业执照日期',
  `linkman_phone` varchar(200) DEFAULT NULL COMMENT '联系人手机',
  `userful_time` varchar(200) DEFAULT NULL COMMENT '组织机构代码有效期',
  `tax_type` varchar(200) DEFAULT NULL COMMENT '纳税类型',
  `dealer_type` varchar(200) DEFAULT NULL COMMENT '经营类型',
  `home_page` varchar(200) DEFAULT NULL COMMENT '公司网站',
  `sale_num` varchar(200) DEFAULT NULL COMMENT '销售额',
  `is_have_ebusiness` varchar(200) DEFAULT NULL COMMENT '是否有电子商务经验',
  `erp_type` varchar(200) DEFAULT NULL COMMENT 'erp类型',
  `web_opera_peo` varchar(200) DEFAULT NULL COMMENT '网站运营人数',
  `user_manage_status` varchar(10) DEFAULT NULL COMMENT '用户运营信息审核状态 0驳回/1待确认/2确认',
  `gp_product_certification` text COMMENT '绿色印刷环境标志产品认证证书',
  `gp_print_business_license` text COMMENT '印刷经营许可证',
  `gp_publication_license` text COMMENT '出版物印制许可证（书刊印刷定点企业证书）',
  `gp_commitment_book` text COMMENT '承诺书',
  `gp_quality_management_certification` text COMMENT 'ISO9001质量管理体系认证证书',
  `gp_environmental_management_certification` text COMMENT 'ISO14001环境管理体系认证证书',
  `is_sanzheng` int(2) DEFAULT '0' COMMENT '是否三证合一',
  `unified_credit_code` varchar(200) DEFAULT NULL COMMENT '统一信用代码',
  PRIMARY KEY (`extend_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1003874 DEFAULT CHARSET=utf8 COMMENT='用户-扩展表(针对用户资质)';

