  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `modify_info_id` bigint(20) DEFAULT NULL COMMENT '关联modify_info表的id',
  `column_name` varchar(100) DEFAULT NULL COMMENT '列名',
