  `after_change_value` varchar(1024) DEFAULT NULL COMMENT '修改完成列中值',
  `change_value_id` varchar(100) DEFAULT NULL COMMENT '要修改的记录ID',
  `change_column_name` varchar(50) DEFAULT NULL COMMENT '被修改表ID列名称',
